const curriculumsList = () => {

    console.log(curriculums);
  
    let curriculums_id = curriculums.map(curriculum => {
      return curriculum.name;
    })
  
    let newEst = estimates.map(el => {
      return el.id;
    });
  
    console.log(newEst);
  
    let curriculumsList = curriculums.map(el => {
      return (
        <tr border='1'>
          <td>{el.id}</td>
          <td>{el.name}</td>
          <td>{el.year}</td>
          <td>{el.speciality_id}</td>
          <td>{el.university_id}</td>
        </tr>
      )
    })
  
    return (
      <div>
          <table>
            <caption>УП</caption>
            <tr border='1'>
              <th>id</th>
              <th>name</th>
              <th>year</th>
              <th>speciality</th>
              <th>university</th>
            </tr>
            {curriculumsList}
          </table>
      </div>
    );
  }

  export default curriculumsList;
